import React from 'react';
import style from './AdminPagePortfolio.module.scss'

const AdminPagePortfolio = props => {
  const {portfilioData} = props;

  const portfilios = portfilioData.map(portfilio =>
  <li className='mb-20' key={portfilio.id}>{portfilio.title}</li>
  )


  return(
	<React.Fragment>
	  <h1 className="h1">Редактировать портфорлио</h1>

	  <ul className={style.wrap}>{portfilios}</ul>
	  <h2>Добавить</h2>

	</React.Fragment>
  )
}
export default AdminPagePortfolio;
